DROP PROCEDURE IF EXISTS SP_LCE_TABLE_INSERTION;
CREATE PROCEDURE SP_LCE_TABLE_INSERTION(OUT SUCCESSFLAG INTEGER)

BEGIN

	DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN 
		ROLLBACK;
		SET SUCCESSFLAG=0;
	END;

	SET AUTOCOMMIT = 0;
	SET SUCCESSFLAG=0;
	START TRANSACTION;

	SET FOREIGN_KEY_CHECKS=0;

	TRUNCATE LCE_TYPE_OF_PROJECT;

	TRUNCATE LCE_PROJECT_LOCATION;

	TRUNCATE LCE_TENDER_ITEMS;

	TRUNCATE LCE_FILE_TEMPLATE;


TRUNCATE LCE_TENDER_SUB_ITEMS; 
	
	TRUNCATE LCE_PRICE_TYPE;

	TRUNCATE LCE_CHECKLIST;

	TRUNCATE LCE_CABLING_TYPE;

	TRUNCATE LCE_AMPERE_RATING;

	TRUNCATE LCE_ITEM_DESCRIPTION;

	TRUNCATE LCE_POWER_FACTOR;

	TRUNCATE LCE_ITEM_BRAND;

	TRUNCATE LCE_TENDER_STATUS;

	TRUNCATE LCE_ERROR_MESSAGE_CONFIGURATION;

	CREATE OR REPLACE VIEW VW_SUB_PROJECT_TITLE AS SELECT LPT_ID,MAX(TM_REV_NO) AS TM_REV_NO FROM LCE_TENDER_MANAGEMENT GROUP BY LPT_ID;

	CREATE OR REPLACE VIEW VW_TENDER_MAX_REC_VER AS select `LCE_TENDER_MANAGEMENT`.`LPT_ID` AS `LPT_ID`,max(`LCE_TENDER_MANAGEMENT`.`TM_REV_NO`) AS `REV_NO` from `LCE_TENDER_MANAGEMENT` group by `LCE_TENDER_MANAGEMENT`.`LPT_ID`;

	TRUNCATE LCE_ITEM_PRICE_DETAILS;



	UPDATE LCE_ITEM_PRICE_DETAILS SET IPD_DESCRIPTION=(SELECT REPLACE(IPD_DESCRIPTION,'"',' inch')) where IPD_DESCRIPTION LIKE '%"%';
	UPDATE LCE_ITEM_PRICE_DETAILS SET IPD_DESCRIPTION=(SELECT REPLACE(IPD_DESCRIPTION,'inch',' inch ')) where IPD_DESCRIPTION LIKE '%"%';
	UPDATE LCE_ITEM_PRICE_DETAILS SET IPD_UNIT_RATE=IPD_CABLE_PRICE WHERE TI_ID=30 AND IPD_CABLE_PRICE IS NOT NULL;
	UPDATE LCE_ITEM_PRICE_DETAILS SET IPD_CABLE_PRICE=NULL WHERE TI_ID=30;

	
	CREATE OR REPLACE VIEW VW_FILE_TEMPLATE AS SELECT F1.FT_ID,IF(F1.FT_PARENT_ID!=0,F1.FT_PARENT_ID,F1.FT_ID),IF(F1.FT_PARENT_ID!=0,F2.FT_DATA	,F1.FT_DATA) AS FT_DATA FROM LCE_FILE_TEMPLATE F1 LEFT JOIN LCE_FILE_TEMPLATE F2 ON F1.FT_PARENT_ID=F2.FT_ID;
	
	
	UPDATE LCE_TENDER_SUB_ITEMS SET TSI_ITEMS='Description' WHERE TSI_FLAG IS NULL AND TSI_ITEMS IS NULL;
	DELETE FROM LCE_ITEM_PRICE_DETAILS WHERE IPD_DESCRIPTION LIKE '%manually to key in%' AND TI_ID not in(5,6)

	DELETE FROM LCE_ITEM_PRICE_DETAILS WHERE IPD_DESCRIPTION LIKE '%manually to key in%' AND TI_ID  in(5,6) AND IPD_SNO NOT IN('5.1.1','6.1.1')
	
	update LCE_ITEM_PRICE_DETAILS set IPD_SNO='5.1.0' WHERE IPD_SNO='5.1.1';
	update LCE_ITEM_PRICE_DETAILS set IPD_SNO='6.1.0' WHERE IPD_SNO='6.1.1';



	SET SUCCESSFLAG = 1;

	SET FOREIGN_KEY_CHECKS =1;

	COMMIT;

END;

CALL SP_LCE_TABLE_INSERTION(@SUCCESSFLAG);
SELECT @SUCCESSFLAG;

DROP PROCEDURE IF EXISTS SP_LCE_TABLE_INSERTION;